  SCREEN_WITH_MOUSE_FOCUS:typing.ClassVar[int]

  SCREEN_WITH_KEYBOARD_FOCUS:typing.ClassVar[int]

  SCREEN_PRIMARY:typing.ClassVar[int]

  SCREEN_OF_MAIN_WINDOW:typing.ClassVar[int]

